  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144305 includes Surface
  underway data collected from Marcus G. Langseth in the Arctic Ocean, Beaufort Sea,
  Bering Sea, Gulf of Alaska, Hawaiian Islands Humpback Whale National Marine Sanctuary
  and North Pacific Ocean from 2011-04-13 to 2011-12-28. These data include BAROMETRIC
  PRESSURE, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and
  SEA SURFACE TEMPERATURE. The instruments used to collect these data include Carbon
  dioxide (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon
  dioxide (CO2) measurement.nnThese data were collected by Taro Takahashi and Stewart
  Sutherland of Columbia University; Lamont-Doherty Earth Observatory and Colm Sweeney
  of University of Colorado at Boulder; Cooperative Institute for Research In Environmental
  Sciences as part of the VOS_Marcus_Langseth_Lines_2011 data set. CDIAC associated
  the following cruise ID(s) with this data set: 33H320110413nnThe Global Volunteer
  Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
  Coordination Project (IOCCP). International groups from 14 countries have been outfitting
  research ships and commercial vessels with automated CO2 sampling equipment to analyze
  the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
